import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/CoolingPage.css'; // Import the CSS file

const coolingData = [
  { id: '67ff0e78173e97a1a082e4bc', name: 'Noctua NH-D15', image: 'data:image/jpeg;base64,', slug: 'noctua-nh-d15' },
  { id: '67ff0e78173e97a1a082e4bd', name: 'Arctic Liquid Freezer II 360', image: 'data:image/jpeg;base64,', slug: 'arctic-liquid-freezer-ii-360' },
  { id: '67ff0e78173e97a1a082e4be', name: 'Corsair iCUE H150i Elite Capellix', image: 'data:image/jpeg;base64,', slug: 'corsair-icue-h150i-elite-capellix' },
  { id: '67ff0e78173e97a1a082e4bf', name: 'be quiet! Dark Rock Pro 4', image: 'data:image/jpeg;base64,', slug: 'be-quiet-dark-rock-pro-4' },
  { id: '67ff0e78173e97a1a082e4c0', name: 'NZXT Kraken Elite RGB 360', image: 'data:image/jpeg;base64,', slug: 'nzxt-kraken-elite-rgb-360' },

];

const CoolingPage = () => {
  return (
    <div className="cooling-page">
      <h2>Browse Cooling</h2>
      <div className="cooling-grid">
        {coolingData.map((cooling) => (
          <Link to={`/product/${cooling.id}`} key={cooling.id} className="cooling-card">
            <img src={cooling.image} alt={cooling.name} />
            <h3>{cooling.name}</h3>
          </Link>
        ))}
      </div>
    </div>
  );
};

export default CoolingPage;
